import React from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import TestWeather from './weatherWidget.js'
import './login.css';

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));

export default function FormPropsTextFields() {
  const classes = useStyles();

  return (
    <form className={classes.root} noValidate autoComplete="off" class="center-middle">
      <div>
        <TextField
          id="standard-user-input"
          label="user"
          type="user"
          autoComplete="current-user"
        />
        <TextField
          id="standard-password-input"
          label="password"
          autoComplete="current-password"
        />
      </div>
      <center>
        <Button variant="outlined" color="primary" onclick={TestWeather}>
        <button className="square" onClick={function() { alert('clic'); }}></button>
          Log in
        </Button>
      </center>
    </form>
  );
}
